INSERT INTO `exams` (`id`, `topic`, `subject`, `time`, `marks`, `instructions`, `created_at`, `updated_at`, `start_at`, `end_at`, `test_series_id`) VALUES
(1, 'General Aptitude Test-1', 'General Aptitude Test-1', 25, 30, '<p><strong>Read the following instructions carefully</strong></p><ol><li>Go through various question palette symbols and understand their meanings before starting the examination.</li><li>After the start of the examination, you can view all the questions by clicking on the <strong>Question Paper</strong> button on the screen.</li><li>The question paper consists of<strong> Multiple Choice Questions (MCQ)</strong> and <strong>Numerical Answer Type (NAT)</strong>.</li><li>a) Multiple choice type questions have four choices A, B, C, D, out of which only <strong>ONE</strong> is the correct answer. Select the answer by clicking on the radio button <img src=\"data:image/png;base64,\"> placed before the choice, with the help of the mouse.</li><li>For numerical answer type questions, a numerical answer should be entered with the help of the mouse and the virtual numeric keypad, which will appear below the question.</li><li>All those questions that are not attempted will carry zero marks. However, wrong answers for multiple choice type questions (MCQ) will carry <strong>NEGATIVE </strong>marks. For multiple choice type questions, a wrong answering will lead to deduction of <strong><em>⅓</em></strong> marks for a 1-mark question and <strong><em>⅔</em></strong> marks for a 2-mark question. There is no negative marking for NAT questions.</li><li>Your answers will be saved on the server periodically and also at the end of the examination. The examination will <strong>stop automatically</strong> at the end of <strong>25 minutes.</strong></li></ol>', '2020-08-02 15:27:31', '2020-09-02 18:51:33', '2020-09-04', '2021-02-08', 4),
