(2, 'GATE 2021 Registration Last Date Extended Till October 07', 'GATE 2021,GATE 2021 Registration,GATE 2021 Registration Last Date,GATE 2021 Registration Extended Date', '<p><em>IIT Bombay has extended the GATE 2021 registration last date till October 7. Check the revised dates on this page below.</em></p>\n<p><img style=\"display: block; margin-left: auto; margin-right: auto;\" src=\"../../../storage/Images/important-announcement.jpg?_t=1601396485\" alt=\"\" width=\"600\" height=\"338\" /></p>\n<p style=\"text-align: justify;\">GATE 2021 registration last date has been extended by the Indian Institute of Technology, Bombay. Now, candidates can submit GATE 2021 application form until October 07. The last date of GATE registration earlier was September 30.</p>\n<p style=\"text-align: justify;\">GATE registration 2021 was started from September 11 and on the request of candidates, the last date to apply for GATE 2021 with regular has been extended to October 07. Subsequently, the date to fill GATE 2021 application form with additional fee has been rescheduled. The application window (with additional fee) will now be open from October 08 to October 12. Candidates will now get 10 days extra for the submission of the application form. Check more details below.</p>\n<h3 style=\"text-align: left;\">GATE 2021 New Registration Dates</h3>\n<table style=\"border-collapse: collapse; width: 60.3283%; height: 66px; margin-left: auto; margin-right: auto;\" border=\"1\">\n<tbody>\n<tr style=\"height: 22px;\">\n<td style=\"width: 33.3899%; height: 22px; text-align: center;\"><strong>Events</strong></td>\n<td style=\"width: 22.7649%; height: 22px; text-align: center;\"><strong>Dates</strong></td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 33.3899%; height: 22px; text-align: center;\">Revised last date to submit the form</td>\n<td style=\"width: 22.7649%; height: 22px; text-align: center;\">07-Oct-2020</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 33.3899%; height: 22px; text-align: center;\">Fill application form with additional fee of Rs 500/-</td>\n<td style=\"width: 22.7649%; height: 22px; text-align: center;\">08-Oct-2020 to 12-Oct-2020</td>\n</tr>\n</tbody>\n</table>\n<h3 style=\"text-align: justify;\">How to fill GATE 2021 Application Form?</h3>\n<p style=\"text-align: justify;\">Candidates meeting the eligibility criteria can only apply for GATE 2021. Follow the instructions given below to fill the application form in online mode:</p>\n<ul style=\"text-align: justify;\">\n<li>Register on GOAPS website</li>\n<li>Fill the GATE application form 2021 by providing personal details, academic details, address, etc.</li>\n<li>Choose the examination centre</li>\n<li>Pay the application fee through the available modes</li>\n<li>Upload the required documents such as photo, signature, Eligibility Certificate, Category certificate (if applicable), PwD certificate (if applicable), etc.</li>\n</ul>\n<h3 style=\"text-align: justify;\">GATE 2021 Application Fee Details</h3>\n<h4 style=\"text-align: justify;\"><strong>GATE 2021 application fee for examination centres in India:</strong></h4>\n<table style=\"border-collapse: collapse; width: 80.3477%; height: 88px; margin-left: auto; margin-right: auto;\" border=\"1\">\n<tbody>\n<tr style=\"height: 22px;\">\n<td style=\"width: 27.2357%; height: 22px; text-align: center;\"><strong>Candidate Category</strong></td>\n<td style=\"width: 24.533%; height: 22px; text-align: center;\"><strong>On or before September 21 (in Rs)</strong></td>\n<td style=\"width: 23.7606%; height: 22px; text-align: center;\"><strong>During the extended period (in Rs)</strong></td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 27.2357%; height: 22px; text-align: center;\">Female candidates (per paper)</td>\n<td style=\"width: 24.533%; height: 22px; text-align: center;\">750</td>\n<td style=\"width: 23.7606%; height: 22px; text-align: center;\">1,250</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 27.2357%; height: 22px; text-align: center;\">SC/ST/PwD category candidates (per paper)</td>\n<td style=\"width: 24.533%; height: 22px; text-align: center;\">750</td>\n<td style=\"width: 23.7606%; height: 22px; text-align: center;\">1,250</td>\n</tr>\n<tr style=\"height: 22px;\">\n<td style=\"width: 27.2357%; height: 22px; text-align: center;\">All other candidates (per paper)</td>\n<td style=\"width: 24.533%; height: 22px; text-align: center;\">1,500</td>\n<td style=\"width: 23.7606%; height: 22px; text-align: center;\">2,000</td>\n</tr>\n</tbody>\n</table>\n<h4 style=\"text-align: justify;\">&nbsp;</h4>\n<h4 style=\"text-align: justify;\"><strong>GATE 2021 application fee f</strong><strong>or candidates at international centres:&nbsp;</strong></h4>\n<table style=\"border-collapse: collapse; width: 86.9271%; margin-left: auto; margin-right: auto;\" border=\"1\">\n<tbody>\n<tr>\n<td style=\"width: 32.0155%; text-align: center;\"><strong>Examination Centres</strong></td>\n<td style=\"width: 25.1599%; text-align: center;\"><strong>On or before September 21 (in US$)</strong></td>\n<td style=\"width: 25.3293%; text-align: center;\"><strong>During the extended period (in US$)</strong></td>\n</tr>\n<tr>\n<td style=\"width: 32.0155%; text-align: center;\">Addis Ababa, Colombo, Dhaka, and Kathmandu (per paper)</td>\n<td style=\"width: 25.1599%; text-align: center;\">50</td>\n<td style=\"width: 25.3293%; text-align: center;\">70</td>\n</tr>\n<tr>\n<td style=\"width: 32.0155%; text-align: center;\">Dubai and Singapore (per paper)</td>\n<td style=\"width: 25.1599%; text-align: center;\">100</td>\n<td style=\"width: 25.3293%; text-align: center;\">120</td>\n</tr>\n</tbody>\n</table>\n<p>&nbsp;</p>', 1, '2020-09-30 16:53:07', '2020-09-30 17:07:12');

