(1, 'PGCET-Karnataka Mock Test Series', 1125.00, '2020-08-10 11:52:17', '2020-10-02 16:30:47', 0.00, '<p>The Karnataka Post Graduate Common Entrance Test - 2020 is being conducted for the purpose of determining the eligibility / merit, for admission of Karnataka and non-Karnataka candidates to 1<sup>st </sup>Year / 1<sup>st </sup>Semester, Full Time / Part Time MBA / MCA / M.E. / M.Tech / M.Arch Courses in Government / University / Private Aided / Private un-Aided Professional Educational Institutions in the State of Karnataka which will be notified by the Government of Karnataka for the Year 2020-21.</p><p>Prepare for the PGCET-KARNATAKA 2020 with GATE-Arch.</p>', '2020-10-02', NULL),
(3, 'MAH-M.arch-CET Online test series', 900.00, '2020-08-15 18:53:30', '2020-10-02 16:29:56', 0.00, '<p>Coming Soon..!!</p>', '2020-10-02', NULL),
(4, 'GATE-Architecture Online test series', 1800.00, '2020-09-02 18:05:05', '2021-01-28 15:58:16', 37.00, '<p>GATE is conducted every year in the month of February. The GATE Score/Rank is mandatory for admission into and/or financial assistance to Master’s programs and direct Doctoral programs in Engineering/ Technology/ Architecture in&nbsp;IISc,&nbsp;IITs and other prestigious Institutes / Universities in India.</p><p>Improve your chances to clear GATE 2021 by practicing with our Total 63 Subject wise and 7 Full length mock test Specially designed for GATE Architecture 2021 preparation.</p>', '2021-01-18', '2021-01-28 15:58:16'),
(5, 'Free Practice Tests for GATE', 0.00, '2020-09-20 11:15:48', '2020-09-20 11:16:22', 0.00, '<p>Free Practice Tests for GATE</p>', '2020-09-19', NULL);

